/* Our picky compiler wants prototypes! */
void Multiply(matvec A, matvec B, matvec Res);
void Test(matvec A, matvec B, matvec Res);
void InitializeA(matvec Array, OP_PRECISION table[UPPERLIMIT*UPPERLIMIT]);
void InitializeB(matvec Array, OP_PRECISION table[UPPERLIMIT*UPPERLIMIT]);

void main()
{
FIM_Instantiate();
/* ***UPPSALA WCET***:
   no printing please! */
   Test(ArrayA, ArrayB, ResultArray);
FIM_exit();
}

void Test(matvec A, matvec B, matvec Res)
/*
 * Runs a multiplication test on an array.  Calculates and prints the
 * time it takes to multiply the matrices.
 */
{
   InitializeA(A,tableA);
   InitializeB(B,tableB);
   Multiply(A, B, Res);
}

void InitializeA(matvec Array, OP_PRECISION table[UPPERLIMIT*UPPERLIMIT])
/*
 * Intializes the given array with random integers.
 */
{
   int OuterIndex, InnerIndex;

   // printf("\n static const OP_PRECISION tableA[512*512]{");
   for (OuterIndex = 0; OuterIndex < UPPERLIMIT; OuterIndex++){
      // printf("\n");
      #pragma clang align
      #pragma clang loop unroll(enable)
      #pragma clang loop vectorize(enable) interleave(enable)
      #if(VWIDTH != 0)
      #pragma clang loop vectorize_width(VWIDTH)
      #endif
      for (InnerIndex = 0; InnerIndex < UPPERLIMIT; InnerIndex++) {
         Array[(OuterIndex*UPPERLIMIT)+InnerIndex] = table[(OuterIndex*UPPERLIMIT)+InnerIndex];
         // printf("%d, ",Array[(OuterIndex*UPPERLIMIT)+InnerIndex]);
      }
   }
   // printf("};\n");
}

void InitializeB(matvec Array, OP_PRECISION table[UPPERLIMIT*UPPERLIMIT])
/*
 * Intializes the given array with random integers.
 */
{
   int OuterIndex, InnerIndex;
   // printf("\n static const OP_PRECISION tableB[512*512]{");
   for (OuterIndex = 0; OuterIndex < UPPERLIMIT; OuterIndex++){
      // printf("\n");
      #pragma clang align
      #pragma clang loop unroll(enable)
      #pragma clang loop vectorize(enable) interleave(enable)
      #if(VWIDTH != 0)
      #pragma clang loop vectorize_width(VWIDTH)
      #endif
      for (InnerIndex = 0; InnerIndex < UPPERLIMIT; InnerIndex++) {
         Array[(OuterIndex*UPPERLIMIT)+InnerIndex] = table[(OuterIndex*UPPERLIMIT)+InnerIndex];
         // printf("%d, ",Array[(OuterIndex*UPPERLIMIT)+InnerIndex]);
      }
   }
   // printf("};\n");
}

void Multiply(matvec A, matvec B, matvec Res)
/*
 * Multiplies arrays A and B and stores the result in ResultArray.
 */
{
   register int Outer, Inner, Index;

   for (Outer = 0; Outer < UPPERLIMIT; Outer++)
      for (Inner = 0; Inner < UPPERLIMIT; Inner++)
      {
         Res [(Outer*UPPERLIMIT)+Inner] = 0;
         #pragma clang align
         #pragma clang loop unroll(enable)
         #pragma clang loop vectorize(enable) interleave(enable)
         #if(VWIDTH != 0)
         #pragma clang loop vectorize_width(VWIDTH)
         #endif
         for (Index = 0; Index < UPPERLIMIT; Index++)
            Res[(Outer*UPPERLIMIT)+Inner]  +=
               A[(Outer*UPPERLIMIT)+Index] * B[Index+(Inner*UPPERLIMIT)];
       }
}
